textOriginal:
Algumas medidas que resolveriam isso são: 
- Taxação de grandes fortunas;
- Cobrar impostos sobre lucros e dividendos;
- Rompimento com o paradigma neoliberal;
- Renda mínima de R$ 1.000,00;
- Fortalecimento da indústria nacional.

Sabe que candidato defendeu isso durante as eleições e vocês ridicularizaram? Ciro Gomes.
Vocês passaram os últimos 2 meses ridicularizando o candidato que propôs a mudança desse quadro e agora vêm fingir que ligam para isso. Infelizmente,  muita gente cai na conversa de vocês.
